import React from "react"

export default class PhoneVerify extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      code: ""
    }
    console.log(window)
  }

  onCodeChange(e) {
    this.setState({
      code: e.target.value
    })
  }

  verifyCode() {
    window.confirmationResult.confirm(this.state.code).then(function (result) {
      // User signed in successfully.
      var user = result.user;
      // ...
    }).catch(function (error) {
      // User couldn't sign in (bad verification code?)
      // ...
    });

  }

  render() {
    return (
      <div id="PhoneVerify">
        <input type="email" placeholder="Verification Code"></input>
        <button id="btn">Submit</button>
      </div>
    )
  }
}
